import React from 'react'
import Hero from '../components/Hero';
import { motion } from 'framer-motion';


const Index = () => {
    return (
        <motion.div
        inital={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        >

            <Hero />
        </motion.div>
    )
}

export default Index
